window.bookSummaryJSON = "<p><b>Rule #1: No fraternizing.</b></p> <p>That was the main rule you had to follow if you wanted to stay employed at Danger Inc. For four years, Dymon Danger never worried about breaking that rule until the day his new assistant, Quinci Everly, walked in his office.</p> <p>Withstanding Dymon’s tactics to make her quit, he realizes that neither Quinci nor his intrusive thoughts were going anywhere anytime soon.</p>"; 
